3x + (2x - 13) &= 92
\\\Rightarrow\qquad 5x - 13 &= 92
\end{align*}
Adding 13 to both sides gives $5x = 105$, and dividing by 5 gives $x = 21$. Therefore, the value of $x$ at the point of intersection is $\boxed{21}$.
